var bacon = (function () {
    var backgroundBacon = "";
    var baconMp3 = "";

    function sizzle() {
        var sizzler = getAudio();

        sizzler.src = 'data:audio/mp3;base64,' + baconMp3;
        if (typeof sizzler.loop == 'boolean'){
            sizzler.loop = true;
        } else {
            sizzler.addEventListener('ended', function() {
                this.currentTime = 0;
                this.play();
            }, false);
        }
        sizzler.play();
    }

    function baconize() {
        //Bacon to background!
        document.body.style.background='url(data:image/png;base64,'+backgroundBacon+')';
        //Sizzle
        sizzle();
    }

    function getAudio() {
        var ribbon = getRibbon(),
            player = document.createElement("audio");

        ribbon.appendChild(player);
        return player;
    }

    function getRibbon() {
        var ribbon = document.getElementById("ribbon");
        if (ribbon === null) {
            ribbon = document.createElement("div");
            ribbon.id = "ribbon";
            ribbon.className = "ribbon";

            ribbon.appendChild(getStitches('top'));
            ribbon.appendChild(getContent());
            ribbon.appendChild(getStitches('bottom'));

            document.getElementsByTagName('body')[0].appendChild(ribbon);
        }

        return ribbon;
    }

    function getStitches(pos) {
        if (pos === 'top' || pos === 'bottom') {
            var stitches = document.getElementById('ribbon-stitches-' + pos);
            if (null === stitches) {
                stitches = document.createElement("div");
                stitches.id = "ribbon-stitches-" + pos;
            }
            return stitches;
        }
        throw new Error('Invalid position!');
    }

    function getContent() {
        var content = document.getElementById("ribbon-content");

        if (null === content) {
            content = document.createElement("strong");
            content.id = "ribbon-content";
            content.onclick = bacon.toggle;
            content.innerHTML = '<h1>Add bacon!</h1>';
        }
        return content;
    }

    return {
        on: function () {

        },
        off: function () {

        },
        toggle: function () {
            baconize();
        },
        enable: function () {
            getRibbon();
        }
    };
})();
